            title: const Text('選一個顏色!'),
            content: SingleChildScrollView(
              child: ColorPicker(
                pickerColor: pickerColor,
                onColorChanged: (color) {
                  pickerColor = color;
                },
                pickerAreaHeightPercent: 0.8,
              ),
            ),
            actions: <Widget>[
              TextButton(
                child: const Text('儲存'),
                onPressed: () {
                  setState(() => selectedColor = pickerColor);
                  Navigator.of(context).pop();
                },
              ),
            ],
          );
        }
    );
  }
  Widget colorPicker() {
    return
      GestureDetector(
        onTap: () {
          _dialogBuilder(context);
        },
        child: ClipOval(
          child: Container(
            padding: const EdgeInsets.only(bottom: 16.0),
            height: 36,
            width: 36,
            decoration: const BoxDecoration(
                gradient: LinearGradient(
                  colors: [Colors.red, Colors.green, Colors.blue],
                  begin: Alignment.topLeft,
                  end: Alignment.bottomRight,
                )),
          ),
        ),
      );
  }
  Widget colorCircle(Color color) {
    return GestureDetector(
      onTap: () {
        setState(() {
          selectedColor = color;
        });
      },
      child: ClipOval(
        child: Container(
          padding: const EdgeInsets.only(bottom: 16.0),
          height: 36,
          width: 36,
          color: color,
        ),
      ),
    );
  }
}
Widget _getClippedImage({
  required Clipper clipper,
  required Color color,
  required GestureTapCallback press,
}) {
  return ClipPath(
    clipper: clipper,
    child: GestureDetector(
      onTap: press,
      child: Container(
        color: color,
      ),
    ),
  );
}
class Clipper extends CustomClipper<Path> {
  Clipper({
    required this.svgPath,
    required this.shiftHeight,
    required this.shiftWidth,
  });
  Path svgPath;
  double shiftHeight;
  double shiftWidth;
  @override
  Path getClip(Size size) {
    final Matrix4 matrix4 = Matrix4.identity();
    matrix4.scale(0.4, 0.4);
    return svgPath.transform(matrix4.storage).shift(Offset(shiftWidth* -0.00001  , shiftHeight* 0.18));
  }
  @override
  bool shouldReclip(CustomClipper oldClipper) {
    return false;
  }
}
